export default function Task(props) {
  return (
    <li className="task">
      <i class="fa-solid fa-star star" onClick="handleImportantToggle"></i>) : (
      <i class="fa-regular fa-star" onClick="handleToggleOff"></i>
      )}
      {props.title}
    </li>
  );
}
